create table videos (
    id varchar not null constraint videos_pkey primary key,
    filename varchar not null,
    storage_id varchar constraint videos_storage_id_key unique,
    audio_id varchar constraint videos_audio_id_key unique,
    title varchar not null,
    description varchar not null,
    posted_at timestamp default CURRENT_TIMESTAMP,
    keywords text,
    document_with_weights tsvector
);
alter table videos owner to lectureforager;
create index storage_id_idx on videos (storage_id);
create index audio_id_idx on videos (audio_id);
create index document_idx_weights on videos using gin (document_with_weights);
